import React, { Component } from 'react';
import Slider from 'react-slick';
import styled from 'styled-components';
import MainBannerContent from './MainBannerContent';

function TopBanner() {
	const settings = {
		dots: false, // 점 안 보이게
		infinite: true, // 무한으로 즐겨요
		speed: 600,
		slidesToShow: 1,
		slidesToScroll: 1,
		// nextArrow: <HandleNextArrow />,
		// prevArrow: <HandlePrevArrow />,
		// arrows: true,
	};

	return (
		<ComponentWrapper>
			<MainBannerContent />
			<Slider {...settings}>
				<p>ㅁㄴㅇㅁㅇ</p>
				<p>ㅁㄴㅇㅁㅇ</p>
				<p>ㅁㄴㅇㅁㅇ</p>
				<p>ㅁㄴㅇㅁㅇ</p>
			</Slider>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	height: auto;
	position: relative;
	overflow: hidden;
`;

export default TopBanner;
